    false,nt"url": null,nt"notes": "This annual narrative report for Illinois
    River National Wildlife and Fish Refuges summarizes refuge activities during calendar
    year 1992.  The report begins with an introduction to the refuge and a summary of
    the yearu2019s highlights and climatic conditions.  Information about monitoring
    and studies- including waterfowl and raptor surveys - is provided next.  Habitat
    restoration and management projects are also covered; activities include wetland
    and upland restoration, water level management, moist soil management, prescribed
    burning, and invasive plant control.  Fish and wildlife management is discussed
    next with emphasis on bird banding and disease monitoring. Coordination activities,
    such as interagency, tribal, and private lands are outlined.  The resource protection
    section provides information about law enforcement and land acquisition.  Information
    about public education and recreation is given including visitor services and outreach
    programs.  Finally, refuge planning and administration are discussed. The Illinois
    National Wildlife and Fish Refuges Complex includes; Emiquon NWR, Chautauqua NWR,
    Cameron-Billsbach Unit, and Meredosia NWR.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
